var mapLoader = function(id, x, y, xx, yy, layer, sceneName){
    if(id != -1){
        if(id == 89) { //Player
            var scene = WIZARD.scene.scenes[sceneName];
            var player = WIZARD.entity.instantiateToScene("player", {x: x * 40, y: y * 40, controlled: true}, sceneName);
            scene.player = player;
        }else if(id == 99) { //Solid
            WIZARD.entity.instantiateToScene("solid", {x: x * 40, y: y * 40, w: 40, h: 40}, sceneName);
        }else if(id == 78) { //Entity random
            WIZARD.entity.instantiateToScene("pickup", {x: x * 40, y: y * 40}, sceneName);
        }else if(id == 79) { //Entity random
            WIZARD.entity.instantiateToScene("player", {x: x * 40, y: y * 40, controlled: false}, sceneName);
        }else{
            var scene = WIZARD.scene.scenes[sceneName];
            if(!scene.tiles) scene.tiles = [];
            if(!scene.tiles["layer" + layer]) scene.tiles["layer" + layer] = [];
            var tiles = scene.tiles["layer" + layer];
            WIZARD.entity.instantiateToList("tile", {x: x * 40, y: y * 40, xx, yy}, tiles);
        }

    }
};
